import React from "react";
import Heading from "./Heading";
import Para from "./Para";
import List from "./List";
import Usersdata from "./Usersdata";

function App() {
  return (
    <>
      <Heading />

      <List
        imgsrc={Usersdata[0].Image}
        title={Usersdata[0].name}
        sname="DARK"
      />
    </>
  );
}
export default App;
